import React, { useState } from "react";
import axios from 'axios';
import { Button, Modal, Form } from "react-bootstrap";
import {IconButton, Select, MenuItem, InputLabel} from '@material-ui/core';
import CreateNewFolderIcon from '@material-ui/icons/CreateNewFolder';

export default function AddFolderButton({ currentUser, folderid }) {
  const [open, setOpen] = useState(false)
  const [name, setName] = useState("")

//   const getAllFolders = async () => {
//       let Folders = await axios({
//           method: "GET",
//           headers: {
//             "Content-Type": "application/json",
//             Authorization: `Bearer ${localStorage.getItem("authToken")}`
//         },
//         url: "http://localhost:5000/api/private/get/folders",
//       })
//     console.log(Folders)
//   }

  function openModal() {
    setOpen(true)
  }

  function closeModal() {
    setOpen(false)
  }

  function handleSubmit(e) {
    e.preventDefault()
  }

  return (
    <>
      <IconButton onClick={openModal} variant="outline-success" size="sm">
        <CreateNewFolderIcon />
      </IconButton>
      <Modal show={open} onHide={closeModal}>
        <Form onSubmit={handleSubmit}>
          <Modal.Body>
            <Form.Group>
              <InputLabel>Choose Folder</InputLabel>
              <MenuItem>10</MenuItem>
            </Form.Group>
          </Modal.Body>
          <Modal.Footer>
            <Button variant="secondary" onClick={closeModal}>
              Close
            </Button>
            <Button variant="success" type="submit">
              Add Folder
            </Button>
          </Modal.Footer>
        </Form>
      </Modal>
    </>
  )
}
